import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';
import logo from './logo.png';

function Navbar() {
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);

  const handleMouseEnter = () => {
    setIsDropdownOpen(true);
  };

  const handleMouseLeave = () => {
    setIsDropdownOpen(false);
  };

  return (
    <div className="container">
      <header className="d-flex flex-wrap align-items-center justify-content-center justify-content-md-between py-3 mb-4 border-bottom">
        <div className="col-md-3 mb-2 mb-md-0">
          <Link to="/" className="d-inline-flex link-body-emphasis text-decoration-none">
            <img src={logo} alt="Logo" height={100} width={100} />
          </Link>
        </div>

        <ul className="nav col-12 col-md-auto mb-2 justify-content-center mb-md-0">
          <li><Link to="/" className="nav-link px-2 link-dark">Home</Link></li>
          
          <li
            className="nav-link px-2 link-dark position-relative"
            onMouseEnter={handleMouseEnter}
            onMouseLeave={handleMouseLeave}
          >
            Shop
            {isDropdownOpen && (
              <ul className="dropdown-menu show position-absolute">
                <li><Link to="/mens" className="dropdown-item">Mens</Link></li>
                <li><Link to="/womens" className="dropdown-item">Womens</Link></li>
                <li><Link to="/new-arrivals" className="dropdown-item">New Arrivals</Link></li>
              </ul>
            )}
          </li>

          <li><Link to="/collections" className="nav-link px-2 link-dark">Collections</Link></li>
          <li><Link to="/about" className="nav-link px-2 link-dark">About</Link></li>
          <li><Link to="/contact" className="nav-link px-2 link-dark">Contact Us</Link></li>
        </ul>

        <div className="col-md-3 text-end">
          <Link to="/login" className="btn btn-outline-dark me-2">Login</Link>
          <Link to="/signup" className="btn btn-dark signup">Sign-up</Link>
        </div>
      </header>
    </div>
  );
}

export default Navbar;
